        <h5>onde ir</h5>
        <h2 class="text-2xxl">Explore Recantos Únicos</h2>
        <p class="mt-5">
          Nas ilhas maravilhosas poderás explorar recantos únicos. Rica em flora e fauna endémica, quem nos visita terá o privilégio de conhecer mais de 26 pássaros endémicos que podem ser observados de norte ao sul.
          As nossas florestas possuem riquezas de plantas com potencialidades de se espantar desde plantas medicinais a flores endémicas como por exemplo a begónia gigante.
          Com um clima equatorial húmido terás muito para desfrutar.
        </p>
        <p>
Na zona norte poderás observar tartarugas. Já no sul sentirás o privilégio de colocar um pé em cada hemisfério no ilhéu das rolas  e dar um mergulho na praia piscina... para os amantes do trekking nada melhor que uma aventura ao pico de São Tomé com 2024 mts de altitude.</p>
